import React, { useState } from 'react';
import axios from 'axios'; // Import axios
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext'; // Import useAuth hook

function LoginPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const { login } = useAuth(); // Dohvatamo login funkciju iz konteksta
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    try {
      const response = await axios.post('http://localhost:8081/auth/login', {
        email,
        password,
      });

      if (response.status === 200) {
        // Destrukturirajte podatke iz response.data
        // Pretpostavljamo da backend vraća token, email, fullName, roles, i doktorID
        const { token, email: userEmail, fullName, roles, doktorID, message } = response.data;

        // Pozovi login funkciju iz AuthContexta sa svim potrebnim podacima
        login(token, roles, userEmail, fullName, doktorID); // Prosljeđujemo doktorID (ili pacijentID, ako je primjenjivo)

        setSuccess(message || 'Login uspješan!');
        console.log('Login uspješan:', response.data);

        // **VAŽNO: Preusmjeri na odgovarajući dashboard na osnovu uloge**
        if (roles.includes('ROLE_ADMIN')) {
          navigate('/admin-dashboard');
        } else if (roles.includes('ROLE_DOCTOR')) {
          navigate('/doctor-dashboard'); // Ispravljena putanja, BEZ ID-a
        } else if (roles.includes('ROLE_PACIJENT')) {
          navigate('/patient-dashboard');
        } else {
          // Ako korisnik nema definisanu dashboard ulogu, preusmjeri na početnu
          navigate('/');
        }
      }
    } catch (err) {
      console.error('Greška prilikom prijave:', err);
      if (err.response && err.response.data && err.response.data.message) {
        setError(err.response.data.message);
      } else {
        setError('Došlo je do greške prilikom prijave. Pokušajte ponovo.');
      }
    }
  };

  return (
    <div className="container d-flex justify-content-center align-items-center" style={{ minHeight: '80vh' }}>
      <div className="card shadow-lg p-4" style={{ maxWidth: '400px', width: '100%' }}>
        <div className="card-body">
          <h2 className="card-title text-center mb-4 text-danger">Login to WinxCare</h2>
          {error && (
            <div className="alert alert-danger text-center" role="alert">
              {error}
            </div>
          )}
          {success && (
            <div className="alert alert-success text-center" role="alert">
              {success}
            </div>
          )}
          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label htmlFor="emailInput" className="form-label">Email address</label>
              <input
                type="email"
                className="form-control"
                id="emailInput"
                placeholder="name@example.com"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>
            <div className="mb-3">
              <label htmlFor="passwordInput" className="form-label">Password</label>
              <input
                type="password"
                className="form-control"
                id="passwordInput"
                placeholder="Password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
              />
            </div>
            <div className="d-grid gap-2 mb-3">
              <button type="submit" className="btn btn-danger btn-lg">Login</button>
            </div>
          </form>
          <div className="text-center mt-3">
            <Link to="/forgot-password" className="text-muted text-decoration-none">Forgot Password?</Link>
          </div>
          <div className="text-center mt-2">
            <p className="text-muted">Do not have an account? <Link to="/sign-up" className="text-danger text-decoration-none">Sign Up</Link></p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default LoginPage;
